import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
} from "react-router-dom";
import Chat from "../../components/chat";
import Footer from "../../components/footer";
import Header from "../../components/header";
import Home from "../../screens/home";
import Order from "../../screens/order";
import { useNavigate } from "react-router-dom";
import { io } from "socket.io-client";
import axios from "axios";
import { serveUrl } from "../index";
import orderId from "../../hooks/useOrderInfo";

const RedirectComponent = () => {
  const navigate = useNavigate();
  console.log("1");
  useEffect(() => {
    console.log("init");
    const socket = io("http://172.16.10.3:60");
    const eventSource = new EventSource(`${serveUrl}/confirm/${orderId}`);

    socket.on("redirect_user", async (data) => {
      const response = await axios.post(
        `${serveUrl}/confirm/${orderId}/passed`,
        {
          transID: data.transID,
          redirect_url: `google.com`,
        }
      );
      const redirectUrl = response.data.redirect_url;
      navigate(redirectUrl);
    });

    return () => {
      eventSource.close();
    };
  }, [navigate]);
};

const AppRouter = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/order/:orderId" element={<Order />} />
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
      <Footer />
      <Chat />
    </Router>
  );
};

export default AppRouter;
